import React from 'react';

const QuantityIncrementButton = () => {
    return (
        <div class="input-group-prepend mb-2">
            <button type="button" class="btn btn-outline-secondary">+</button>
            <input type="text" class="form-control" style={{width : "20%"}}/>
            <button type="button" class="btn btn-outline-secondary">-</button>
            <div className='bg-success p-2 mr-1'>Mua hàng</div>
                              <div className='bg-success p-2'>Thêm vào giỏ hàng</div>
        </div>                
    );
}
export default QuantityIncrementButton;
